webpackJsonp([422],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-clear-specific-values-from-your-browser-local-storage.json":function(e,o){e.exports={data:{markdownRemark:{html:'<p>Removing specific values from your browser\'s local storage will solve many problems related to the browser crashing or freezing on FreeCodeCamp.</p>\n<p>This solves, as example, a common problem with browser hanging out in a challenge\'s page after saving a response with an infinite loop.</p>\n<p>When this happens, you must delete the value in <code>localStorage</code> storing that response.</p>\n<h2>In Chrome:</h2>\n<ul>\n<li>\n<p>On <strong>freecodecamp.com</strong>, open your developer tools.</p>\n<ul>\n<li>More tools > Developer tools (or <code>Ctrl</code> + <code>Shift</code> + <code>I</code> (Windows), <code>Cmd</code> + <code>Opt</code> + <code>I</code> (Mac))</li>\n</ul>\n</li>\n<li>\n<p>Navigate to the <code>Resources</code> tab</p>\n</li>\n<li>\n<p>Expand the <code>Local Storage</code> item in the left pane</p>\n</li>\n<li>\n<p>Select <code>http://www.freecodecamp.com</code></p>\n</li>\n<li>\n<p>Find the challenge you wish to delete data in the right pane <img src="//discourse-user-assets.s3.amazonaws.com/original/2X/8/8300d3dfcf8a07bc3c1f69e7dd730d99e353972d.png" alt="Finding a key in localStorage Chrome Developer Tools"></p>\n</li>\n<li>\n<p>Right click the desired challenge and select <code>Delete</code></p>\n</li>\n</ul>\n<h2>In Firefox:</h2>\n<ul>\n<li>\n<p>On <strong>freecodecamp.com</strong>, open your web console with</p>\n<ul>\n<li><code>Ctrl</code> + <code>Shift</code> + <code>K</code></li>\n</ul>\n</li>\n<li>\n<p>From there, using directly the console:</p>\n<ul>\n<li>\n<p>Type <code>console.log(localStorage);</code> and hit <code>Enter</code>.</p>\n</li>\n<li>\n<p>Click in <code>Storage</code> link. <img src="//discourse-user-assets.s3.amazonaws.com/original/2X/e/e3778d1c24e9da6fe506564405b5b1ebc11facc1.png" alt="Print the localStorage Object from web console and show the Storage"></p>\n</li>\n<li>\n<p>The <strong>Storage</strong> panel will appear at right.</p>\n</li>\n<li>\n<p>Filter the results to find the Algorithm, Front End Project or Challenge causing the problem.</p>\n</li>\n<li>\n<p>When located, mouse over it and click the <code>x</code> at right. <img src="//discourse-user-assets.s3.amazonaws.com/original/2X/a/a309e8ec8d92301f3507001ca3a796009d0a00d8.png" alt="Click the x for deleting the value entry."></p>\n</li>\n<li>\n<p>Once removed, check if the problem was solved. Refresh or close and open the browser if necessary.</p>\n</li>\n</ul>\n</li>\n</ul>\n<p><strong>Note:</strong> This can also be done with the <a href="https://developer.mozilla.org/en-US/docs/Tools/Storage_Inspector">Storage Inspector</a>, but seems like Firefox hangs out when there are so many values.</p>',frontmatter:{title:"Clear Specific Values from Your Browser Local Storage",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/clear-specific-values-from-your-browser-local-storage/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/clear-specific-values-from-your-browser-local-storage/"}}}});
